            <div className="ces3">

            </div>

            <div className="ces4">

            </div>
        
        <style jsx>{`
        .ces{
            display:flex;
            flex-direction:column;
            height:100%;
            width:100%;
        }
        .ces1{
            background:blue;
            height:10%;
        }
        .ces2{
            background:blue;
            height:20%;
        }
        .ces3{
            background:blue;
            height:30%;
        }
        .ces4{
            background:blue;
            height:30%;
        }
        
        `}


        </style>
        
        </div>
    )

}

}
export default CyberExposureScore;
